import React from "react";
import ReactDOM from "react-dom";
import store from "./store/store";
import App from "./App";
store.firebaseAuthIsReady.then(() => {
  ReactDOM.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>,
    document.getElementById("root")
  );
});
